Template.adminDashboard.helpers({
	users: function() {
		return Meteor.users.find();
	},
	userRole: function() {
		if(this.profile.role === 'Admin' && this.profile.role != 'Member' ) {
			return "selected"
		} else if(this.profile.role === 'Member' && this.profile.role != 'Admin' ) {
			return "selected"
		}
	}
});
